import React from "react";

const Skill = () => {
    return (
        <>
            <h1 className="text-primary">Skills</h1>
            <ul class="skills__list">
                <li class="skills__list-item btn btn--plain">HTML</li><li class="skills__list-item btn btn--plain">CSS</li><li class="skills__list-item btn btn--plain">JavaScript</li><li class="skills__list-item btn btn--plain">TypeScript</li><li class="skills__list-item btn btn--plain">React</li><li class="skills__list-item btn btn--plain">Redux</li><li class="skills__list-item btn btn--plain">SASS</li><li class="skills__list-item btn btn--plain">Material UI</li><li class="skills__list-item btn btn--plain">Git</li><li class="skills__list-item btn btn--plain">CI/CD</li><li class="skills__list-item btn btn--plain">Jest</li><li class="skills__list-item btn btn--plain">Enzyme</li></ul>
        </>
    );
}

export default Skill
